--  DDL for View VW_TSS_NFINC_CLAIM
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "LEPTM"."VW_TSS_NFINC_CLAIM" ("RET_NF_NO", "RET_NF_SERIE", "CNPJ_SHIP_TO", "DO", "NF_ORIG", "RDO") AS 
  SELECT 
T.RET_NF_EXT_NO RET_NF_NO ,T.RET_NF_SERIES RET_NF_SERIE, O.UDF6 CNPJ_SHIP_TO, O.ORDER_NO DO , N.NF_EXT_NO NF_ORIG , T.REF_NO_INVOICE RDO
FROM TC_ORDERS T
INNER JOIN OD_ORDERS O ON T.REF_NO = O.ORDER_NO
LEFT JOIN NF_OD_ORDERS N ON N.DO_NO = O.ORDER_NO AND N.DELETE_YN = 'N'
WHERE T.ORDER_CLASS <> '01' AND T.STATUS_CD = '00210';
REM INSERTING into LEPTM.VW_TSS_NFINC_CLAIM
SET DEFINE OFF;
